oxy_webhelp_navlinks = {"vs_recovery_vm-d22872e21256":{"topics":[{"title":"Large file recovery with VMware tools and disk mount","shortdesc":"<p class=\"shortdesc\">Large file recovery uses VMware tools and disk mount to restore large files         efficiently, enhancing the speed for faster data recovery operations.<\/p>","href":"cdm\/vs_large_file_recovery_vmware_tools.html","attributes":{"data-id":"vs_large_file_recovery_vmware_tools"},"menu":{"hasChildren":false},"tocID":"vs_large_file_recovery_vmware_tools-d22872e21267","topics":[]},{"title":"Recovering a file or a folder from a vSphere virtual machine","shortdesc":"<p class=\"shortdesc\">When files are deleted, corrupted, or encrypted, recover files or folders from a         vSphere virtual machine using snapshots, replicas, or archival snapshots for data         restoration. <span class=\"ph\">RSC<\/span> provides multiple recovery options, enabling seamless data         retrieval and minimizing downtime.<\/p>","href":"saas\/vs_recovering_file_folder_vsphere_vm.html","attributes":{"data-id":"vs_recovering_file_folder_vsphere_vm"},"menu":{"hasChildren":false},"tocID":"vs_recovering_file_folder_vsphere_vm-d22872e21278","topics":[]},{"title":"Downloading virtual machine files","shortdesc":"<p class=\"shortdesc\">Download virtual machine files from Rubrik clusters to perform data         analysis.<\/p>","href":"saas\/vs_downloading_virtual_machine_files.html","attributes":{"data-id":"vs_downloading_virtual_machine_files"},"menu":{"hasChildren":false},"tocID":"vs_downloading_virtual_machine_files-d22872e21292","topics":[]},{"title":"Creating a Live Mount of a vSphere virtual machine","shortdesc":"<p class=\"shortdesc\">When you are unable to access a vSphere virtual machine or when a virtual machine is         deleted, create a virtual machine from a point-in-time copy of the source virtual machine on         the vSphere VM page.<\/p>","href":"saas\/vs_creating_live_mount.html","attributes":{"data-id":"vs_creating_live_mount"},"menu":{"hasChildren":false},"tocID":"vs_creating_live_mount-d22872e21303","topics":[]},{"title":"Creating live mounts in a batch","shortdesc":"<p class=\"shortdesc\">When you are unable to access several vSphere virtual machines, or when multiple         virtual machines are deleted and are required to be live-mounted together, create live         mounts in a batch.<\/p>","href":"saas\/vs_creating_live_mounts_in_batch.html","attributes":{"data-id":"vs_creating_live_mounts_in_batch"},"menu":{"hasChildren":false},"tocID":"vs_creating_live_mounts_in_batch-d22872e21314","topics":[]},{"title":"Creating a Live Mount of a virtual disk snapshot of a vSphere virtual machine","shortdesc":"<p class=\"shortdesc\">A Live Mount creates a virtual disk or disks from point-in-time copies of the disks         on a source vSphere virtual machine. The recovered virtual disks use the Rubrik cluster as         the datastore.<\/p>","href":"saas\/vs_creating_live_mount_vdisk_snapshot.html","attributes":{"data-id":"vs_creating_live_mount_vdisk_snapshot"},"menu":{"hasChildren":false},"tocID":"vs_creating_live_mount_vdisk_snapshot-d22872e21325","topics":[]},{"title":"Performing instant recovery for vSphere virtual machines","shortdesc":"<p class=\"shortdesc\">Perform an instant recovery to replace the source vSphere virtual machine with a         fully functional point-in-time copy.<\/p>","href":"saas\/vs_performing_an_instant_recovery.html","attributes":{"data-id":"vs_performing_an_instant_recovery"},"menu":{"hasChildren":false},"tocID":"vs_performing_an_instant_recovery-d22872e21336","topics":[]},{"title":"Exporting a vSphere virtual machine on CDM clusters 8.0 and earlier","shortdesc":"<p class=\"shortdesc\">To create a new vSphere virtual machine from a point-in-time copy of the source         virtual machine, export a vSphere virtual machine on Rubrik CDM version 8.0 or earlier. <\/p>","href":"saas\/vs_exporting_vm_8_0_earlier.html","attributes":{"data-id":"vs_exporting_vm_8_0_earlier"},"menu":{"hasChildren":false},"tocID":"vs_exporting_vm_8_0_earlier-d22872e21347","topics":[]},{"title":"vSphere VM template export","shortdesc":"<p class=\"shortdesc\">You can export a vSphere VM template snapshot as a virtual machine or as a VM         template.<\/p>","href":"saas\/vs_vm_template_export.html","attributes":{"data-id":"vs_vm_template_export"},"menu":{"hasChildren":false},"tocID":"vs_vm_template_export-d22872e21358","topics":[]},{"title":"Exporting a vSphere virtual machine","shortdesc":"<p class=\"shortdesc\">Export a vSphere virtual machine snapshot or a VM template managed through a vCenter         folder or content library to create a point-in-time copy for backup or         migration.<\/p>","href":"saas\/vs_exporting_vm.html","attributes":{"data-id":"vs_exporting_vm"},"menu":{"hasChildren":false},"tocID":"vs_exporting_vm-d22872e21369","topics":[]},{"title":"Exporting a vSphere VM template as a VM template","shortdesc":"<p class=\"shortdesc\">You can export a vSphere VM template that is managed either through a vCenter folder         or a content library to a new VM template. Exporting a VM template allows you to create a         copy of a virtual machine that you can use to create and provision new virtual         machines.<\/p>","href":"saas\/vs_exporting_vmt_as_vmt.html","attributes":{"data-id":"vs_exporting_vmt_as_vmt"},"menu":{"hasChildren":false},"tocID":"vs_exporting_vmt_as_vmt-d22872e21381","topics":[]},{"title":"Powering off after Instant Recovery or Live Mount","shortdesc":"<p class=\"shortdesc\">Power off a mounted virtual machine from the Live Mounts page of the <span class=\"ph\">RSC<\/span> web         UI.<\/p>","href":"saas\/vs_power_off_mounted_vm.html","attributes":{"data-id":"vs_power_off_mounted_vm"},"menu":{"hasChildren":false},"tocID":"vs_power_off_mounted_vm-d22872e21392","topics":[]},{"title":"Unmounting after Instant Recovery or Live Mount","shortdesc":"<p class=\"shortdesc\">After performing instant recovery or creating a live mount of a virtual machine,         remove the virtual machine from the Live Mounts page.<\/p>","href":"saas\/vs_unmounting_after_instant_recovery_or_live_mount.html","attributes":{"data-id":"vs_unmounting_after_instant_recovery_or_live_mount"},"menu":{"hasChildren":false},"tocID":"vs_unmounting_after_instant_recovery_or_live_mount-d22872e21406","topics":[]},{"title":"Removing a virtual machine entry after live migration","shortdesc":"<p class=\"shortdesc\">After live migration of a recovered virtual machine, for example through the VMware         Storage vMotion process, the Rubrik cluster maintains an entry for the migrated virtual         machine on the Live Mounts page.<\/p>","href":"saas\/vs_removing_vm_entry_after_migration.html","attributes":{"data-id":"vs_remove_vm_entry_after_migration"},"menu":{"hasChildren":false},"tocID":"vs_remove_vm_entry_after_migration-d22872e21417","topics":[]},{"title":"Migrating to a vCenter datastore","shortdesc":"<p class=\"shortdesc\">Migrate the VMDKs for a live mounted virtual machine to a vCenter Server datastore. Migration moves the data and control of the VMDKs to the vCenter Server. Migration also frees up the Rubrik cluster storage that was used for the datastore.<\/p>","href":"saas\/vs_migrating_to_a_vcenter_datastore.html","attributes":{"data-id":"vs_migrating_to_a_vcenter_datastore"},"menu":{"hasChildren":false},"tocID":"vs_migrating_to_a_vcenter_datastore-d22872e21428","topics":[]},{"title":"In-Place Recovery of virtual machines","shortdesc":"<p class=\"shortdesc\">VMware In-Place Recovery is a faster and more efficient alternative for virtual         machine recovery, compared with other VMware recovery options.<\/p>","href":"common\/vs_in_place_recovery.html","attributes":{"data-id":"vs_in_place_recovery"},"menu":{"hasChildren":false},"tocID":"vs_in_place_recovery-d22872e21439","next":"vs_in_place_recovery-d22872e21439"},{"title":"Bulk recovery of vSphere virtual machines","shortdesc":"<p class=\"shortdesc\">If you want to recover multiple vSphere virtual machines at the same time, you can         use the vSphere VMs page to perform a bulk recovery operation.<\/p>","href":"saas\/vs_bulk_recovery_of_vm.html","attributes":{"data-id":"vs_bulk_recovery_of_vm"},"menu":{"hasChildren":false},"tocID":"vs_bulk_recovery_of_vm-d22872e21472","next":"vs_bulk_recovery_of_vm-d22872e21472"}]}};